import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter, Route } from 'react-router-dom'

import App from './App';

class Routes extends Components {
	render(){
		<BrowserRouter>
			<Route path="/" component={App}></Route>
		</BrowserRouter	>
	}
};

export default Routes;
